const CUSTOMIZATION_TABLE={azul:{target:"color",value:"#01579B"},preto:{target:"color",value:"#000000"},verde:{target:"color",value:"#1B5E20"},vermelho:{target:"color",value:"#B71C1C"},carteira:{target:"icon",value:"fas fa-wallet"},celular:{target:"icon",value:"fas fa-mobile-alt"},smartphone:{target:"icon",value:"fas fa-mobile-alt"}},IRRELEVANT_TAG_CLASSES=["tag","is-normal","is-dark"];function customizeColor(e,t){e.style.color="#ffffff",e.style.background=t}function customizeIcon(e,t){let a=document.createElement("span");a.className="icon";let o=document.createElement("i");o.className=t,a.appendChild(o),e.innerHTML="",e.appendChild(a)}function applyCustomization(e,t){let a=CUSTOMIZATION_TABLE[t],o=a.target,l=a.value,r={color:customizeColor,icon:customizeIcon};if(r.hasOwnProperty(o)){(0,r[o])(e,l)}}function getTags(e){return e.getElementsByClassName("tag")}function getClasses(e){return Array.from(e.classList).filter(e=>!IRRELEVANT_TAG_CLASSES.includes(e))}function start(e){let t=getTags(e);for(let e of t){let t=getClasses(e);console.log(t);for(let a of t)CUSTOMIZATION_TABLE.hasOwnProperty(a)&&applyCustomization(e,a)}}start(document);